import * as React from 'react';
import TextField from '@mui/material/TextField';
import './Home.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <TextField id="outlined-basic" label="Outlined" variant="outlined" defaultValue="Enter name..."/>
      </header>
    </div>
  );
}

export default App;
